import React from 'react';
import productsList from './products';

function Products() {
    return (
      <div>
      {productsList.map((item => {
        return(
        <div>
          <p>this is my products page</p>
          <h2>{item.title}</h2>
          <img src={item.image} alt={item.alt}/>
          <p>{item.price}</p>
          <p>{item.description}</p>
        </div>)
      }))}
      </div>
    );
  }


export default Products
